import Map from "../components/Map";
import InputForm from "../components/InputForm";
import "./Leaflet.css";

const Airlines = () => {
    return (
        <div>
        <h1>Airlines Page</h1>
        <br></br><br></br>
        <InputForm />
        <br></br><br></br>
        <Map />
        </div>)
};

export default Airlines;
